INSERT INTO `out_systems` (`id`, `title`, `content`, `example`, `min`, `fee`, `account`, `valid`, `alias`) VALUES
(1, 'Payeer', 'Выплаты осуществляются в автоматическом режиме. Процент при выводе составляет 1% <BR /><BR />\r\nИз платежной системы Payeer Вы можете вывести свои средства в автоматическом режиме на большинство известных платежных системы и международных банков.<BR /><BR />\r\n<b>Ссылки на учебные материалы:</b><BR />\r\n - <a href="http://payeeer.ru/create" target="_blank">Создание счета в Payeer</a> <BR />\r\n - <a href="http://payeeer.ru/outpay" target="_blank">Вывод средств из payeer</a> <BR /><BR />', 'P1526291', 5, 1.00, 4, '^P[0-9]{7,15}|.+@.+..+$', 'payeer'),
(2, 'OOOPay', 'Выплаты осуществляются в автоматическом режиме. <BR />\r\nКомиссия системы состовляет 1%. <BR /><BR />\r\nИз платежной системы OOOPay Вы можете вывести свои средства на большинство известных платежных системы и международных банков.<BR /><BR />', 'WM123456789', 100, 1.00, 5, '^WM[0-9]{9}$', 'ooopay'),
(3, 'WebMoney', 'Выплаты осуществляются автоматически в течении 5 - 12 часов.\r\nКомиссия платежного шлюза: 5%.', 'R123456789012', 100, 5.00, 6, '^[R][0-9]{12}$', 'webmoney'),
(4, 'QIWI', 'Выплаты осуществляются автоматически в течении 5 - 12 часов.\r\nКомиссия платежного шлюза: 5%.', '+71234567890', 100, 5.00, 7, '^[+](91|916|82|372|375|374|44|998|972|66|90|81|1|507|7|77|380|371|370|996|9955|992|373|84)[0-9]{6,14}$', 'qiwi'),
(5, 'Яндекс Деньги', 'Выплаты осуществляются автоматически в течении 5 - 12 часов.\r\nКомиссия платежного шлюза: 5%.', ' 41055433311254', 100, 5.00, 8, '^41001[0-9]{7,10}$', 'ya');
