INSERT INTO `site_pages_constant` (`id`, `title`, `content`, `alias`, `meta_title`, `meta_keywords`, `meta_description`, `meta_modify`) VALUES
(1, 'Ответы на частые вопросы', '&nbsp;\n<div class="faq_q">- Как играть, в чем суть?</div>\n\n<div class="faq_a">- Суть в том, что несколько человек вкладывают деньги в общий банк, через 30 секунд этот банк достается одному человеку (победитель выбирается случайным образом). Чем больше игрок вложил в банк, тем больше у него шансов выиграть. Каждая лотерея длится минуту. Отсчет времени начинается после ставок от двух игроков.</div>\n\n<div class="faq_q">- В чем особенности сайта fast-win.top?</div>\n\n<div class="faq_a">- Наше отличие от привычных лотерей в честности и абсолютной прозрачности. Вы можете видеть сколько человек купили билеты, какой призовой фонд, каков бюджет розыгрыша, можете оценить свои риски и шансы на успех.</div>\n\n<div class="faq_q">- Могу ли я играть, если мне еще нет 18 лет?</div>\n\n<div class="faq_a"> Нет! Наш сервис предназначен только для лиц, достигших совершеннолетия. Если вам нет 18 лет - пожалуйста, покиньте наш сайт.</div>\n\n<div class="faq_q">- Какая комиссия при розыгрыше?</div>\n\n<div class="faq_a">- Комиссия 8% для реф-системы и 12% комиссия сайта. Итого 20%.</div>\n\n<div class="faq_q">- Если я поставлю 100 рублей, а мой оппонент - 10 рублей. Если я выиграю, при ставке 100 рублей я получу 88 рублей?</div>\n\n<div class="faq_a">- Нет! Комиссия берется со всех ставок, кроме ставки победителя.</div>\n\n<div class="faq_q">- Я выиграл хорошую сумму и хочу сделать выплату! Как долго вы обрабатываете заявки?</div>\n\n<div class="faq_a">- Заявки на webmoney, qiwi и яндекс-деньги обрабатываются в течение 12 часов. Выплаты на кошелек payeer обрабатываются автоматически моментально.</div>\n\n<div class="faq_q">- Вчера я заказывал выплату на qiwi и получил деньги через минуту. Сегодня я заказал еще одну выплату и прошло уже 3 минуты, почему нет денег?</div>\n\n<div class="faq_a">- Заявки могут обрабатываться ДО 12 ЧАСОВ. Об этом написано на странице заказа выплат!</div>\n\n<div class="faq_q">- Какой лимит на снятие средств?</div>\n\n<div class="faq_a">- У нас есть ограничения, которые описаны на этой странице - http://fast-win.top/pay_limits/. Если вы не отмываете деньги и не накручиваете бонусы, то никаких неудобств у вас не возникнет! Вы можете снимать деньги со своего баланса в любое время и в любом количестве. Ограничений нет.</div>\n\n<div class="faq_q">- Какие формы платежей и снятия денег со счета Вы предлагаете?</div>\n\n<div class="faq_a">- Чтобы увидеть список методов оплаты в своем Личном Кабинете нажмите на кнопку &laquo;Пополнить счет&raquo;. Чтобы увидеть список доступных способов вывода выигрышей, в своем Личном Кабинете нажмите на кнопку &laquo;Заказать выплату&raquo;.</div>\n\n<div class="faq_q">- Я разгадаю вашу формулу и буду постоянно выигрывать!</div>\n\n<div class="faq_a">- У нас нет никакой формулы или алгоритма. Все работает на абсолютной случайности, по аналогии с вытаскиванием билета из мешка. А формулу мешка с билетами невозможно разгадать или построить закономерность.</div>\n\n<div class="faq_q">- На сайтах с розыгрышами скинов есть защита md5, значит у них честно! А у вас нет md5, у вас все подкручено!</div>\n\n<div class="faq_a">- Повторяем еще раз, каждый наш розыгрыш - абсолютная случайность. То что вы видели на других сайтах про md5 или какие-то обещания что нет подкруток - полная ЧУШЬ. У нас вы можете пообщаться с любым победителем и убедиться что это не бот, а обычный пользователь, такой же как вы.</div>\n\n<div class="faq_q">- У вас есть партнерская программа? Какие условия?</div>\n\n<div class="faq_a">- Да, у нас есть 3-уровневая партнерская программа. После входа в аккаунт, в разделе <a href="/account/referals">Мои рефералы</a> вам доступна ссылка для привлечения пользователей. Вы будете пожизненно получать 5% от ставок игроков, которых вы пригласили, по 2% с рефералов 2-го и и 1% с рефералов 3-го уровня.</div>\n<br />\n&nbsp;', 'faq', 'Fast-Win: ответы на вопросы', 'Fast-Win: ответы на вопросы', 'Fast-Win: ответы на вопросы', '2017-06-18 00:00:00'),
(2, 'Политика конфиденциальности', '<br/><br/>\n<h4>1. Мы не храним каких-либо данных пользователя, кроме тех, что можно найти на странице в соц. сети <a href="https://vk.com/">vk.com</a>.<br />\n<br />\n2. Данные, которые передаются в автоматическом режиме: IP, cookie, параметры и настройки интернет-браузеров, место нахождения пользователя, совершаемые им действиях и т.д. носят обезличенный характер, в связи с чем не относятся к составу персональных данных.</h4>\n<br />\n&nbsp;', 'conf', 'Политика конфиденциальности', 'Политика конфиденциальности Fast-Win, политика фаст лото', 'Политика конфиденциальности Fast-Win', '2017-06-18 00:00:00'),
(3, 'Пользовательское соглашение', '&nbsp;\n<h3>Общие положения Пользовательского соглашения</h3>\n1.1. В настоящем документе и вытекающих или связанным с ним отношениях Сторон применяются следующие термины и определения:<br />\nа) Платформа &mdash; программно-аппаратные средства, интегрированные с Сайтом Администрации;<br />\nб) Пользователь &mdash; дееспособное физическое лицо, присоединившееся к настоящему Соглашению в собственном интересе либо выступающее от имени и в интересах представляемого им юридического лица.<br />\nв) Сайт Администрации/Сайт &mdash; интернет-сайты, размещенные в домене <a href="http://fast-win.top/">fast-win.top</a> и его поддоменах.<br />\nг) Сервис &mdash; комплекс услуг и лицензия, предоставляемые Пользователю с использованием Платформы.<br />\nд) Соглашение &mdash; настоящее соглашение со всеми дополнениями и изменениями.<br />\n<br />\n1.2. Использование вами Сервиса любым способом и в любой форме в пределах его объявленных функциональных возможностей, включая:<br />\n&nbsp; ● просмотр размещенных на Сайте материалов;<br />\n&nbsp; ● регистрация и/или авторизация на Сайте;<br />\n&nbsp; ● размещение или отображение на Сайте любых материалов, включая но не ограничиваясь такими как: тексты, гипертекстовые ссылки, изображения, аудио и видео- файлы, сведения и/или иная информация;<br />\nсоздает договор на условиях настоящего Соглашения в соответствии с положениями ст.437 и 438 Гражданского кодекса Российской Федерации.<br />\n<br />\n1.3. Воспользовавшись любой из указанных выше возможностей по использованию Сервиса вы подтверждаете, что:<br />\nа) Ознакомились с условиями настоящего Соглашения в полном объеме до начала использования Сервиса.<br />\nб) Принимаете все условия настоящего Соглашения в полном объеме без каких-либо изъятий и ограничений с вашей стороны и обязуетесь их соблюдать или прекратить использование Сервиса. Если вы не согласны с условиями настоящего Соглашения или не имеете права на заключение договора на их основе, вам следует незамедлительно прекратить любое использование Сервиса.<br />\nв) Соглашение (в том числе любая из его частей) может быть изменено Администрацией без какого-либо специального уведомления. Новая редакция Соглашения вступает в силу с момента ее размещения на Сайте Администрации либо доведения до сведения Пользователя в иной удобной форме, если иное не предусмотрено новой редакцией Соглашения.<br />\n&nbsp;\n<h3>Общие условия пользования Сервисом</h3>\n2.1. Использование функциональных возможностей Сервиса допускается только после прохождения Пользователем регистрации и авторизации на Сайте в соответствии с установленной Администрацией процедурой.<br />\n2.2. Технические, организационные и коммерческие условия использования Сервиса, в том числе его функциональных возможностей доводятся до сведения Пользователей путем отдельного размещения на Сайте или путем нотификации Пользователей.<br />\n<br />\n<br />\n&nbsp;', 'rules', 'Общие правила проекта', 'Правила, помятка пользователя, правила проекта', 'Общие правила проекта', '2017-06-18 00:00:00'),
(4, 'Контакты', '<br/><br/>\n\n<center>\n	<h3>Для связи с технической поддержкой перейдите по вкладке "Служба поддержки" в меню вашего аккаунта. <br/><br/>\n	<br/>\n	Для связи без регистрации на сайте используйте e-mail: <u>fast-win-top@yandex.ru</u></h3>\n</center>\n\n<br/><br/>', 'contacts', 'Контакты', 'Контакты Fast-Win, контакты фаст лото', 'Контакты Fast-Win', '2017-06-18 00:00:00'),
(5, 'Для регистрации нужен всего один клик!', '<br />\n<span style="font-size:18px"><span style="font-family:courier new,courier,monospace">Для входа в личный кабинет вам необходима учетная запись на сайте <a href="https://vk.com/" target="_blank">vk.com</a><br />\nНажимая на кнопку <strong>&quot;Войти&quot;</strong> вы подтверждете что вы ознакомились и согласились с <a href="/rules/">Пользовательским соглашением</a>.<br />\nНажимая на кнопку <strong>&quot;Войти&quot;</strong> <span style="color:#FF0000">вы подтверждете что вам исполнилось 18 лет.</span></span></span><br />\n<br />\n&nbsp;', 'signin', 'Вход в аккаунт', 'Вход в аккаунт', 'Вход в аккаунт', '2017-06-18 00:00:00');
