INSERT INTO `tpl_emails` (`id`, `key`, `title`, `head`, `content`, `description`) VALUES
(1, 'registr_user', 'Регистрация пользователя (пользов.)', 'Регистрация на сайте Fast-Win', '<h2 style="font-style:italic;">Благодарим Вас за регистрацию на нашем сайте.</h2>\n\n<div style="background:#eee;border:1px solid #ccc;padding:5px 10px;">Регистрационные данные: Логин - &#39;{email}&#39;<br />\nПароль - &#39;{password}&#39;</div>\n\n<p>Перейдите по этой ссылке для активации аккаунта: <a href="{link}" target="_blank">{link}</a></p>\n', ''),
(2, 'aktcode_resend', 'Повторный запрос кода активации', 'Fast-Win. Повторный запрос кода активации', '<p><br />\r\nВами была повторно запрошена ссылка активации аккаунта на сайте <span style="color:#B22222;"><em><strong>SITNAME</strong></em></span>.<br />\r\n<br />\r\nСсылка активации - <a href="{link}" target="_blank">{link}</a></p>\r\n', ''),
(3, 'registr_manag', 'Регистрация пользователя (менедж.)', 'Регистрация на сайте Fast-Win', '<h2 style="font-style:italic;">Благодарим Вас за регистрацию на нашем сайте.</h2>\r\n\r\n<div style="background:#eee;border:1px solid #ccc;padding:5px 10px;">Регистрационные данные: Логин - &#39;{email}&#39;<br />\r\nПароль - &#39;{password}&#39;</div>\r\n\r\n<p>Перейдите по этой ссылке для активации аккаунта: <a href="{link}" target="_blank">{link}</a></p>\r\n', '');
